import React, { useState } from "react";
import { Link } from "react-router-dom";
import { Carousel } from "primereact/carousel";
import { Button } from "primereact/button";
import "./HomePage.css";
import "primereact/resources/themes/lara-light-indigo/theme.css";
import "primereact/resources/primereact.min.css";
import "primeicons/primeicons.css";

export default function HomePage() {
  const gallery = [
    { url: "/fdiba-event.jpg", alt: "Event 1" },
    { url: "/fdiba-event-2.jpg", alt: "Event 2" },
    { url: "/fdiba-event-3.jpg", alt: "Event 3" },
    { url: "/fdiba-event-4.jpg", alt: "Event 4" },
  ];

  // Set images state with gallery data directly
  const [images, setImages] = useState(gallery);

  const responsiveOptions = [
    {
      breakpoint: "1024px",
      numVisible: 1,
      numScroll: 1,
    },
    {
      breakpoint: "768px",
      numVisible: 1,
      numScroll: 1,
    },
    {
      breakpoint: "560px",
      numVisible: 1,
      numScroll: 1,
    },
  ];

  const imageTemplate = (image) => {
    return <img src={image.url} alt={image.alt} style={{ width: "100%" }} />;
  };

  return (
    <>
      <div className="header">
        <div className="headingContainer">
          <img src="/fdiba-logo.png" alt="FDIBA Logo" className="logo" />
          <h3>FDIBA Alumni</h3>
        </div>
        <ul className="navigationList">
          <li className="navigationItem">
            <Link to="/">Home</Link>
          </li>
          <li className="navigationItem">
            <Link to="/about">About</Link>
          </li>
          <li className="navigationItem">
            <Link to="/contact">Contact</Link>
          </li>
        </ul>
      </div>
      <main>
        <h1>Welcome to the Alumni Network!</h1>
        <p>
          This network helps you stay connected with fellow alumni and leverage
          professional opportunities.
        </p>
        <Carousel
          value={images}
          itemTemplate={imageTemplate}
          numVisible={1}
          numScroll={1}
          responsiveOptions={responsiveOptions}
        />
        <div className="buttons">
          <Button
            label="Register Now"
            className="p-button-raised p-button-info"
            onClick={() => (window.location.href = "/register")}
          />
          <Button
            label="Login"
            className="p-button-raised p-button-info"
            onClick={() => (window.location.href = "/login")}
          />
        </div>
      </main>
      <div className="footer">
        <div className="emailContainer">
          <p>
            Contact us at:{" "}
            <a href="mailto:contact@fdiba.tu-sofia.bg">
              contact@fdiba.tu-sofia.bg
            </a>
          </p>
        </div>
        <div className="socialMediaContainer">
          <p>Follow us on social media: </p>
          <div className="socialMediaIcons">
            <a href="https://www.facebook.com/FDIBA.TU.SOFIA">
              <img src="/facebook-logo.png" alt="Facebook" className="icon" />
            </a>
            <a href="https://www.instagram.com/fdiba.tu.sofia/">
              <img src="/instagram-logo.png" alt="Instagram" className="icon" />
            </a>
            <a href="https://www.linkedin.com/company/fdiba/">
              <img src="/linkedin-logo.png" alt="LinkedIn" className="icon" />
            </a>
          </div>
        </div>
      </div>
    </>
  );
}
